              </TabPane>
              {/*<TabPane tab={<span><Icon type="android" />Emails</span>} key="cancelledinvoice">
                <CancelledInvoice/>
              </TabPane>*/}
            </Tabs>

          </Card>
          </Row>
        </div>
    }
}

export default BillingSettings;
